            //日付にデフォルトで今日の日付を指定
            const date = new Date();
            const yyyy = date.getFullYear();
            let MM = date.getMonth() + 1;
            if (String(MM).length == 1) {
                MM = ""0"" + String(MM);
            }
            const dd = date.getDate();
            const today = yyyy + ""-"" + MM + ""-"" + dd;
            document.getElementById(""date"").setAttribute(""value"", today);

            //今日の日付を指定
            $(""#today"").text(MM + ""/"" + dd);
        });
    </script>
